-- Table structure for ra_data_backup
CREATE TABLE `ra_data_backup` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `table_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '远程下拉',
  `file` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '备份文件',
  `remark` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '备注',
  `status` tinyint unsigned NOT NULL DEFAULT '0' COMMENT '状态:0=未开始,1=成功,2=失败',
  `runnow` tinyint unsigned NOT NULL DEFAULT '1' COMMENT '立即开始:0=否,1=是',
  `run_time` bigint unsigned DEFAULT NULL COMMENT '执行时间',
  `create_time` bigint unsigned DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=365 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='数据备份';

